CREATE TABLE tq_author (
  authorID int(11) NOT NULL,
  authorName varchar(255) DEFAULT NULL,
  displayName varchar(255) DEFAULT NULL,
  authorDOB date DEFAULT '0000-00-00',
  authorPhone varchar(100) DEFAULT NULL,
  authorEmail varchar(255) DEFAULT NULL,
  authorDescription text DEFAULT NULL,
  authorImage varchar(255) DEFAULT NULL,
  seoUri varchar(255) DEFAULT NULL,
  dateAdded datetime DEFAULT NULL,
  dateModified datetime DEFAULT NULL,
  status tinyint(1) NOT NULL DEFAULT 1
